                  <Route component={asyncComponent(() => import('../../../components/Error404'))} />
                )}
              />
            )}
          </RoleContext.Consumer>
        )}
      />

      <Route component={asyncComponent(() => import('../../../components/Error404'))} />
    </Switch>
  </div>
);
export default Administration;
